import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import DisplayCards from './DisplayCards.js'

ReactDOM.render(
  <React.StrictMode>
    <DisplayCards />
    <App />

  </React.StrictMode>,
  document.getElementById('root')
);
